import * as React from "react";
import { 
    List, Datagrid, TextField, EmailField,
    ReferenceInput, SelectInput, TextInput, Edit,
    EditButton, SimpleForm, Create
} from 'react-admin';
import {DateTimeField} from '../components'

export const UserList = props => (
    <List {...props}>
        <Datagrid rowClick="edit">
            <TextField source="user_name" />
            <EmailField source="user_email" />
            <DateTimeField label='Date' source="created_timestamp" />
            <EditButton label="Edit"/>
        </Datagrid>
    </List>
);

const EditTitle = ({ record }) => {
    return <span>Post {record ? `"${record.title}"` : ''}</span>;
};

export const UserEdit = props => (
    <Edit title={<EditTitle />} {...props}>
        <SimpleForm>
            <TextInput disabled source="id" />
            <TextInput source="user_name" />
            <TextInput source="user_email" />
            <TextInput disabled hidden={false} label="Created" source="created_timestamp" defaultValue={new Date()}/>
        </SimpleForm>
    </Edit>
);

export const UserCreate = props => (
    <Create {...props}>
        <SimpleForm>
            <TextInput source="user_name" />
            <TextInput source="user_email" />
            <TextInput source="user_email" />
        </SimpleForm>
    </Create>
);
